import React from 'react'

function Main() {
    const card = {
        name:"Ahmed",
        age:38,
        adress:"Egypt",
        education:"High school"
    }
    return (
        <>
            
             <h3>Your Name is{card.name}</h3>
             <h3>your age is {card.age}</h3>
             <h3>your adress is {card.adress}</h3>
             <h3>your education is {card.education}</h3>
               
    </>
  )
}

export default Main
